American Bandits: Frank and Jesse James (2010) 	



Verenigde Staten
Western
88 minuten

geregisseerd door Fred Olen Ray
met Peter Fonda, George Stults en Tim Abell

Nadat Jesse James gewond raakt, gaan zijn bendeleden ieder hun eigen weg, met het voornemen om elkaar weer te treffen in de verlaten spookstad Gila Wells. De vastberaden federale marshal Kane is hen op het spoor en vastbesloten om de bende in te rekenen als ze in Gila Wells aankomen.


English

Storyline
After Jesse James is wounded by a bullet to the chest, Frank James splits the gang up and plans a rendezvous in four days time. With U.S.-Marshall Kane in hot pursuit, and betrayal within the outlaw band, the stage is set for a blazing and climactic shootout in the deserted town of 'Gila Wells'


